import React, { Component } from 'react';
import { Navbar, Nav } from 'react-bootstrap';

class Referral extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <code>
        {`
          <div
            className='swell-referral'
            data-formLayout='single_row'
            data-title="swell widgets rule"
            data-explain="Swell rules. Everyone loves it."
            data-new-user-submit="Go"
            shareLinks='facebook,twitter,sms,copylink,message'
            data-exist-user-submit="Start"
            data-exist-userplaceholder="igal Igal"
          ></div>
        `}
      </code>
    );
  }
}

export default Referral;
